        <span>hello world how are you diuhg</span>
        <div>
        <span>13m views . 2 days ago</span>
        <div>
            <div>
                {/* <Icon /> */}
                <p>73k</p>
            </div>
            <div>
                {/* <Icon /> */}
                <p>30k</p>
            </div>
        </div>
        </div>

        <div>
            <Img2>
                <img src={img}/>
            </Img2>
            <div>
                <button>SUBCRIBED</button>
                <h3>3m Subcribers</h3>
            </div>
        </div>
    </Main>
  )
}

export default DetailsFeedScreen

const Main = styled.div`
width: 67%;
background-color: #282828;
min-height: 100vh;

`
const Img = styled.div`
width: 80%;
overflow: hidden;
height: 50vh;
display: grid;
place-items: center
